  05> KEMP, Athel Lewis m on 11.04.1923 to NICOL, Jessie Isobel
  b 22.01.1894 d 02.06.1990
  b 01.09.1901 d 21.02.1988
  Athel b. at "Matahiia" station, Ruatoria, m. at St Andrew's Presbyterian Church,
  | Gisborne and d. at Gisborne. Jessie, d/o William Nicol and Rachael Borthwick.
  Athel farmed at Ruatoria where he hand-milked a herd of about 100 cows as well as
  running sheep and cattle on other leasehold properties. He was amongst the first
  to supply the Ngati Porou Dairy Company and was a director of the company for a
  | number of years. He was a farming adviser for the Department of Maori Affairs and
  did much to help the development of Maori farming in the district. He was also a member of the Ruatoria
  Racing Club. The farm was sold in the 1940's and Athel went to Warkworth for a short while before returning
  to retirement in Gisborne. Athel was a keen trout fisherman and devoted at great deal of time to the
  introduction of fingerlings into many East Coast rivers. For this work he was granted Life Membership of
  the Acclimatisation Society. His other interest was gardening.
  Prior to their marriage, Jessie was the school teacher at Ruatoria.
